In 2019, @reas, @ricksilva.jpg, @wheresaddie, and artist duo @exonemo (SEMBO Kensuke and AKAIWA Yae) invited a group of artists to bring one editioned artwork to swap with each other over the course of a week. The experiment was called a2p, short for artist-to-peer network, and it became the basis for the structure and ethos of Feral File. 

Now, over two years since Feral File launched, The Experiment brings a2p back into focus, with Feral File’s first non-collectable exhibition.

