📬 MoMA Postcard 🌍

MoMA Postcard is a web3 experiment in borderless, collaborative creativity that invites any and all to participate.

Built with blockchain tools by the decentralized team at Autonomy, each Postcard is co-owned and co-created, stamp by stamp, person by person.

The First 15 kick off MoMA Postcard.

